import React from 'react'
import { Link } from 'react-router-dom'

const Welcome = () => {
  return (
    <div>
    <h1 className=' my-5' align="center">Welcome Admin ..!!</h1>
    <h6 className='my-5' align="center">To view exams click below</h6>
    <Link to="/admin/updateExam"  align="center"><button className='btn-primary'>View exams</button></Link>
    </div>
  )
}

export default Welcome
